import { Navbar } from '../styles/estilosNavbar';

export default class extends React.Component {
  render() {
    return (
      <Navbar className="navbar">
        <a className="opcion" href="#home">
          Home
        </a>
        <a className="opcion" href="#news">
          News
        </a>
        <div className="dropdown">
          <button className="dropbtn">
            Dropdown
            <i className="fa fa-caret-down"></i>
          </button>
          <div className="dropdown-content">
            <a href="#">Link 1</a>
            <a href="#">Link 2</a>
            <a href="#">Link 3</a>
          </div>
        </div>
      </Navbar>
    );
  }
}
